The Doors were an American rock band formed in 1965 in Los Angeles, California by vocalist Jim Morrison, keyboardist Ray Manzarek, drummer John Densmore, and guitarist Robby Krieger. They were considered a controversial and influential band, due mostly to Morrison's cryptic lyrics and unpredictable stage persona. After Morrison's death on July 3, 1971, the remaining members continued as a threesome until disbanding in 1973. Despite a career that barely totaled eight years, The Doors still enjoy a huge cult following as well as status in the mainstream music industry as being hugely influential and original. According to the RIAA, they have sold over 32.5 million albums in the US alone.

